import ReactDOM from 'react-dom';
import {BrowserRouter, Route, Link} from 'react-router-dom';

class Works extends React.Component {
  render(){
    return(
      <div className="">
        <h1>Works</h1>
        <ul className="">
          <li className=""><Link className="" to="/works/1">Shodo</Link></li>
          <li className=""><Link className="" to="/works/2">Watchface</Link></li>
          <li className=""><Link className="" to="/works/3">Miscellenous</Link></li>
        </ul>

        <div className="">
          <h2>Shodo</h2>
          <p>Hi, I'm Yu Ohno who works in nantoka-japan support team.</p>

        </div>



      </div>
    )
  }
}
export default Works;
